import{_ as e,o as t,c as a,O as i}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 28.2-700 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/28.2-700.md","filePath":"vacode/28.2-700.md"}'),o={name:"vacode/28.2-700.md"},r=i('<h1 id="§-28-2-700-definitions" tabindex="-1">§ 28.2-700 Definitions. <a class="header-anchor" href="#§-28-2-700-definitions" aria-label="Permalink to &quot;§ 28.2-700 Definitions.&quot;">​</a></h1><p>As used in this chapter, unless the context requires a different meaning:</p><p>&quot;Crab dredge&quot; means a device, which may have teeth on the bar, that is designed and used to catch crabs buried in the bottom.</p><p>&quot;Crab pot&quot; means a device made of wire or thread net used to catch crabs.</p><p>&quot;Peeler crab&quot;, until the Commission promulgates a different definition, means a crab that has a soft shell fully developed under the hard shell, or a crab on which there is a pink or white line or rim on the edge of that part of the back fin next to the outer section of this fin.</p><p>&quot;Peeler pot&quot; means a wire mesh pot baited with only live adult male (jimmy) blue crabs.</p><p>Code 1950, §§ 28-170, 28-173; 1954, c. 368; 1956, c. 293; 1960, c. 517; 1962, c. 406, §§ 28.1-165, 28.1-169; 1964, c. 393; 1966, c. 684; 1968, c. 785; 1970, c. 726; 1979, c. 274; 1983, cc. 307, 603, § 28.1-165.1; 1985, c. 180; 1990, c. 154; 1992, c. 836; 1995, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0129" target="_blank" rel="noreferrer">129</a>; 1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0229" target="_blank" rel="noreferrer">229</a>.</p>',7),n=[r];function c(s,h,d,l,p,f){return t(),a("div",null,n)}const m=e(o,[["render",c]]);export{u as __pageData,m as default};
